import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

const routes: Routes = [
  {
    path:'',
    redirectTo:'home',
    pathMatch:'full',
  },
  {
    path:'home',
    loadChildren: () => 
        import('./pages/productos/list-producto/list-routing.module').then(m => m.ListarProductoRoutingModule)
  },
  {
    path:'detalle',
    loadChildren: () => import('./pages/productos/detalle-producto/detalle-routing.module').then(m => m.DetalleRoutingModule)
  }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
